En del posttjänster och frimärken kommer inom kort att vara befriade från moms. Det gäller bland annat frimärken som inte säljs i samlarsyfte. De nya reglerna grundar sig på en dom från EU-domstolen där Sverige förra året dömdes för fördragsbrott. Domstolen ansåg att den nuvarande svenska lagen bryter mot EU-rätten eftersom alla posttjänster och frimärken är skattepliktiga.
Riksdagens skatteutskott menar att förändringen kan påverka konkurrensen på postmarknaden negativt men att förändringen ändå måste genomföras eftersom Sverige är skyldiga att följa domen från EU. Utskottet utgår ifrån att regeringen noga kommer följa hur förändringen påverkar konkurrenssituationen. Bland annat kan det göras genom den utredning om postlagstiftningen som redan tillsatts.
Riksdagen sa ja till regeringens förslag. De nya reglerna börjar gälla den 1 april 2016.&nbsp;
